/*Выбрать 200 строк детализации в формате, приведенном на рисунке. Учесть, что в детализации могут отсутствовать значения полей "местоположение абонента" и "направление вызова". */;
SELECT 
    combined.phone AS номер,
    ct.name AS тип_соединения,
    al.name AS местоположение_абонента,
    cdir.name AS направление_вызова
FROM (
    SELECT 
        phone,
        conn_type,
        abonent_location,
        call_direction
    FROM 
        call_detail
    UNION ALL
    SELECT 
        phone,
        conn_type,
        abonent_location,
        call_direction
    FROM 
        call_detail_old
) AS combined
LEFT JOIN 
    conn_type ct ON combined.conn_type = ct.i_id
LEFT JOIN 
    abonent_location al ON combined.abonent_location = al.i_id
LEFT JOIN 
    call_direction cdir ON combined.call_direction = cdir.i_id
LIMIT 200;

/*Отобразить сумму трафика (call_detail.traffic) сгруппированного по каждому номеру телефона. Включать только записи с типами вызова:  "Интернет услуга" и все варианты содержащие в названии слово "GPRS".*/

CREATE TEMPORARY TABLE temp_call_detail AS
SELECT 
    phone,
    conn_type,
    abonent_location,
    call_direction,
    SUM(traffic) AS total_traffic,
    SUM(sec_duration) AS total_duration
FROM (
    SELECT 
        phone, 
        conn_type, 
        abonent_location, 
        call_direction, 
        traffic, 
        sec_duration
    FROM call_detail

    UNION ALL

    SELECT 
        phone, 
        conn_type, 
        abonent_location, 
        call_direction, 
        traffic, 
        sec_duration
    FROM call_detail_old
) AS combined_data
GROUP BY 
    phone, conn_type, abonent_location, call_direction
HAVING 
    COUNT(*) = 1 OR SUM(traffic) > 0;

SELECT 
    cd.phone AS номер,
    SUM(cd.total_traffic) AS сумма_трафика
FROM 
    temp_call_detail cd
JOIN 
    conn_type ct ON cd.conn_type = ct.i_id
WHERE 
    ct.name = 'Интернет услуга' OR ct.name LIKE '%GPRS%'
GROUP BY 
    cd.phone
ORDER BY сумма_трафика DESC;

/* Отобразить список номеров, которые находились в роуминге.*/
SELECT DISTINCT 
    combined.phone AS номер
FROM (
    SELECT 
        phone, 
        abonent_location
    FROM 
        call_detail
    UNION ALL
    SELECT 
        phone, 
        abonent_location
    FROM 
        call_detail_old
) AS combined
JOIN 
    abonent_location al ON combined.abonent_location = al.i_id
WHERE 
    al.rouming = 1;

